class Cart_modles {  Product? product;  int? quantity;  bool? isOrdered;  int? id;  Cart_modles({this.product, this.quantity, this.isOrdered, this.id});  Cart_modles.fromJson(Map<String, dynamic> json) {    product =    json['product'] != null ? new Product.fromJson(json['product']) : null;    quantity = json['quantity'];    isOrdered = json['is_ordered'];    id = json['id'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.product != null) {      data['product'] = this.product!.toJson();    }    data['quantity'] = this.quantity;    data['is_ordered'] = this.isOrdered;    data['id'] = this.id;    return data;  }}class Product {  int? id;  String? title;  String? banner;  String? description;  Category2? category;  List<Colors>? colors;  int? price;  bool? isAvailable;  bool? showHide;  bool? isFeatured;  bool? isFav;  List<ProductImage>? productImage;  Product(      {this.id,        this.title,        this.banner,        this.description,        this.category,        this.colors,        this.price,        this.isAvailable,        this.showHide,        this.isFeatured,        this.isFav,        this.productImage});  Product.fromJson(Map<String, dynamic> json) {    id = json['id'];    title = json['title'];    banner = json['banner'];    description = json['description'];    category = json['category'] != null        ? new Category2.fromJson(json['category'])        : null;    if (json['colors'] != null) {      colors = <Colors>[];      json['colors'].forEach((v) {        colors!.add(new Colors.fromJson(v));      });    }    price = json['price'];    isAvailable = json['is_available'];    showHide = json['show_hide'];    isFeatured = json['is_featured'];    isFav = json['is_fav'];    if (json['product_image'] != null) {      productImage = <ProductImage>[];      json['product_image'].forEach((v) {        productImage!.add(new ProductImage.fromJson(v));      });    }  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this.id;    data['title'] = this.title;    data['banner'] = this.banner;    data['description'] = this.description;    if (this.category != null) {      data['category'] = this.category!.toJson();    }    if (this.colors != null) {      data['colors'] = this.colors!.map((v) => v.toJson()).toList();    }    data['price'] = this.price;    data['is_available'] = this.isAvailable;    data['show_hide'] = this.showHide;    data['is_featured'] = this.isFeatured;    data['is_fav'] = this.isFav;    if (this.productImage != null) {      data['product_image'] =          this.productImage!.map((v) => v.toJson()).toList();    }    return data;  }}class Category2 {  String? title;  Category2({this.title});  Category2.fromJson(Map<String, dynamic> json) {    title = json['title'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['title'] = this.title;    return data;  }}class Colors {  String? colorCode;  Colors({this.colorCode});  Colors.fromJson(Map<String, dynamic> json) {    colorCode = json['color_code'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['color_code'] = this.colorCode;    return data;  }}class ProductImage {  String? image;  ProductImage({this.image});  ProductImage.fromJson(Map<String, dynamic> json) {    image = json['image'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['image'] = this.image;    return data;  }}